import java.util.Arrays;

/**
 * QuickSort
 */
public class QuickSort {

    public boolean isAnagram(String s, String t) {
        if (s.length() != t.length()) {
            return false;
        } else {
            char[] charS = s.toCharArray();
            char[] charT = t.toCharArray();
            s = qsort(charS, 0, charS.length - 1);
            t = qsort(charT, 0, charT.length - 1);

            if (s.equals(t))
                return true;
            else
                return false;
        }
    }

    private static String qsort(char[] cArr, int lo, int hi) {
        if (lo >= hi) {
            new String(cArr, lo, hi - lo + 1);
        } else {
            int pIdx = partition(cArr, lo, hi);
            qsort(cArr, lo, pIdx - 1);
            qsort(cArr, pIdx + 1, hi);
        }

        return String.valueOf(cArr);
    }

    private static int partition(char[] cArr, int lo, int hi) {
        char p = cArr[hi];
        int idx = lo - 1;

        for (int i = lo; i < hi; i++) {
            if (cArr[i] <= p) {
                idx++;
                char tmp = cArr[i];
                cArr[i] = cArr[idx];
                cArr[idx] = tmp;
            }
        }

        idx++;
        cArr[hi] = cArr[idx];
        cArr[idx] = p;

        return idx;
    }

    public static void main(String[] args) {
        String a = "";
        String b = "";
        
        long startTime = System.currentTimeMillis();
        // Call your function here
        a = qsort(a.toCharArray(),0,a.length()-1);
        b = qsort(b.toCharArray(), 0, b.length()- 1);

        
        boolean km = (a.equals(b));
        // Record the end time
        long endTime = System.currentTimeMillis();

        // Calculate and print the elapsed time
        long elapsedTime = endTime - startTime;
        System.out.println("Time taken: " + elapsedTime + " milliseconds");
        System.out.println(km);
    
    }
}